interface TechIconProps {
  tech: string;
  className?: string;
}

// Icon mapping type
type IconMapping = {
    [key: string]: React.FC<SVGProps<SVGSVGElement>> | React.FC<IconBaseProps>;
  };

// TechIcons component
const TechIcons: React.FC<TechIconProps> = ({ tech, className = "" }) => {
  const iconProps: SVGProps<SVGSVGElement> = {
    // size: 24,
    width: 24,
    height: 24,
    className: `${className} text-primaryduo`,
  };

  const iconMapping: IconMapping = {
    React: ReactIcon,
    TypeScript: TypeScriptIcon,
    ReactNative: ReactIcon,
    "Tanstack": TanStack,
    "Node.js": NodeIcon,
    "Three.js": TbBrandThreejs,
    Solidity: SolidityIcon,
    "Next.js": Nextjs,
    "Astro.js": Astro,
    ChartJs: Chartjs,
    GraphQL: GraphQL,
    Hardhat: Hardhat,
    Etherjs: FaEthereum,
    PostgreSQL: PostgreSQL,
    MySQL: MySQL,
    Firebase: Firebase,
    Supabase: Supabase,
    AppWrite: Appwrite,
    Twilio: Twilio,
    Stripe: Stripe,
    Rust: FaRust,
    Git: Git,
    Docker: Docker,
    Jest: Jest,
    Tailwind: TailwindCSS,
    RadixUI: SiRadixui,
    MUI: MaterialUI,
    ChakraUI: SiChakraui,
    Postman: Postman,
    GitLab: GitLab,
    BitBucket: bitbucket,
    SCSS: CSSNew,
    SolidJs: TbBrandSolidjs,
    Subgraphs: thegraph,
    Mantine: SiMantine,
    ViteJs: TbBrandVite,
    AWS: FaAws
    // Add more mappings as needed
  };

  const IconComponent = iconMapping[tech] || PlaceholderIcon;
   // Check if the IconComponent is from react-icons
   const isReactIcon = IconComponent === SiChakraui || IconComponent === FaEthereum || IconComponent === FaRust || IconComponent === TbBrandSolidjs || IconComponent === SiRadixui || IconComponent === SiMantine || IconComponent === TbBrandThreejs || IconComponent === TbBrandVite || IconComponent ===  FaAws;

   if (isReactIcon) {
    return <IconComponent size={20} className={`${className} text-primaryduo`} />;
  }

  return <IconComponent {...iconProps} />;
};

